import React from 'react';
import Container from './components/Container/Container';
import GameScreen from './components/gameScreen/GameScreen';


function App() {
  return (
    <Container>
      <h1>
        Space Invaders
      </h1>
      <GameScreen />
    </Container>
  );
}

export default App;
